import React from 'react';

function Rating({rating}){
    console.log(rating)
    const Star = [1,2,3,4,5];
    return(
        Star.forEach(element => {
            if(element<={rating}){
                console.log(element)
                return (<li key={element} className = 'Stars-item red'>★</li>)
            }else{
                return (<li key={element} className = 'Stars-item grey'>★</li>)
            }
            
        })
    )
}

export default Rating;
